import React from 'react'

export default function Movie(props) {
    const {title} = props;
    return (
        <div>
                           <div className='movie-container'>
                                     <div className='movie-image'></div>
                                       <p className='movie-title'>{title}</p>
                                     <p className='movie-year'></p>
                            </div>


                           
        </div>
    )
}
